), \false), new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ClosureType([], new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\MixedType(), \false), \TenantCloud\BetterReflection\Relocated\PHPStan\TrinaryLogic::createYes()], [new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ClosureType([], new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\IntegerType(), \false), new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ClosureType([], new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\UnionType([new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\IntegerType(), new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\StringType()]), \false), \TenantCloud\BetterReflection\Relocated\PHPStan\TrinaryLogic::createMaybe()], [new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ClosureType([], new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\UnionType([new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\IntegerType(), new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\StringType()]), \false), new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ClosureType([], new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\IntegerType(), \false), \TenantCloud\BetterReflection\Relocated\PHPStan\TrinaryLogic::createYes()], [new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\CallableType(), new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ClosureType([], new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\MixedType(), \false), \TenantCloud\BetterReflection\Relocated\PHPStan\TrinaryLogic::createYes()], [new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ObjectWithoutClassType(), new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ClosureType([], new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\MixedType(), \false), \TenantCloud\BetterReflection\Relocated\PHPStan\TrinaryLogic::createYes()], [new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ClosureType([], new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\MixedType(), \false), new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ObjectWithoutClassType(), \TenantCloud\BetterReflection\Relocated\PHPStan\TrinaryLogic::createMaybe()], [new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ObjectWithoutClassType(new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ClosureType([], new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\MixedType(), \false)), new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ClosureType([], new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\MixedType(), \false), \TenantCloud\BetterReflection\Relocated\PHPStan\TrinaryLogic::createNo()], [new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ObjectWithoutClassType(new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ObjectType(\Closure::class)), new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ClosureType([], new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\MixedType(), \false), \TenantCloud\BetterReflection\Relocated\PHPStan\TrinaryLogic::createNo()], [new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ClosureType([], new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\MixedType(), \false), new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ObjectWithoutClassType(new \TenantCloud\BetterReflection\Relocated\PHPStan\Type\ObjectType(\Closure::class)), \TenantCloud\BetterReflection\Relocated\PHPStan\TrinaryLogic::createNo()]];
    }
    /**
     * @dataProvider dataIsSuperTypeOf
     * @param Type $type
